def my_test(url):
    with sync_playwright() as playwright:
        chromium = playwright.chromium # or "firefox" or "webkit".
        browser = chromium.launch(headless=False)
        page = browser.new_page()
        page.goto(url)
        print(page.url)
        # other actions...
        browser.close()
        print("Hello~~~")


def get_historic_price(abbr, global_dict):
    results = []
    with sync_playwright() as playwright:
        # Get specific company's historical price then calculate its 20MA price (price per month)
        url = "https://finance.yahoo.com/"

        try:

            chromium = playwright.chromium # or "firefox" or "webkit".    
            browser = chromium.launch(headless = False)
            context = browser.new_context(
                # viewport={'width': 1600, 'height':1200}
                )  # Allowed to create multiple pages with the same set of custom header
            page = context.new_page()  # Create a new page
            page.goto(url, timeout = 120000, wait_until = "domcontentloaded")
            print("'Yahoo finance' requested completely!")
            time.sleep(2 + np.random.rand())


            # 找到輸入公司簡稱的input
            page.get_by_placeholder("Quote Lookup").type(abbr, delay = 3000 + np.random.rand() * 1000)  # , delay = 3000 + np.random.rand() * 1000
            time.sleep(3 + np.random.rand())
            # smart_hint_selector = "css=[data-id=search-assist-input-sugglst]"
            # page.wait_for_selector(smart_hint_selector, state = "attached", timeout = 30000)
            page.keyboard.press("Enter", delay = np.random.rand() * 1000 + 3000)   
            # page.wait_for_load_state(timeout = 120000)  # After 'load' event

            
            # 取得跳轉該公司頁面後的公司名稱
            com_name_selector = "#quote-header-info > div.Mt\(15px\).D\(f\).Pos\(r\) > div.D\(ib\).Mt\(-5px\).Maw\(38\%\)--tab768.Maw\(38\%\).Mend\(10px\).Ov\(h\).smartphone_Maw\(85\%\).smartphone_Mend\(0px\) > div.D\(ib\) > h1"
            company_name = page.wait_for_selector(com_name_selector, state = "attached", timeout = 30000).inner_text() 



            print("Get targeted company completely!")  
            print(company_name)       


            # 點hisotorical data
            # type_selector = "#quote-nav > ul > li.IbBox.Fw\(500\).fin-tab-item.H\(44px\).desktop_Bgc\(\$hoverBgColor\)\:h.desktop-lite_Bgc\(\$hoverBgColor\)\:h.selected > a > span"           
            #quote-nav > ul > li.IbBox.Fw\(500\).fin-tab-item.H\(44px\).desktop_Bgc\(\$hoverBgColor\)\:h.desktop-lite_Bgc\(\$hoverBgColor\)\:h.selected > a > span
            # page.wait_for_selector(type_selector, state = "attached", timeout = 30000).click(timeout = 5000, delay = np.random.rand() * 1000)
            page.get_by_text("Historical Data").click(timeout = 120000, delay = 3000 + np.random.rand() * 2000)
            # page.wait_for_load_state(timeout=120000)  # After 'load' event
            print("點歷史資料")
            time.sleep(5)

            # 點Frequency: Monthly
            page.get_by_text("Daily").click(timeout = 120000, delay = 3000 + np.random.rand() * 1000)
            # page.locator("span").filter(has_text = "Daily").click(timeout = 120000, delay = 3000 + np.random.rand() * 1000)
            menu = page.locator("data-test=historicalFrequency-menu")
            # page.locator("css=[data-value=1mo]").click(timeout = 5000, delay = np.random.rand() * 1000)
            menu.get_by_text("Monthly").click(timeout = 120000, delay = 3000 + np.random.rand() * 1000)
            # page.wait_for_load_state(timeout=120000)  # After 'load' event
            print("選擇月為單位")
            time.sleep(5)

            page.locator("#Col1-1-HistoricalDataTable-Proxy > section > div.Pt\(15px\) > div.Bgc\(\$lv1BgColor\).Bdrs\(3px\).P\(10px\) > div:nth-child(1) > div > div").click(timeout = 120000, delay = 5000 + np.random.rand() * 2000)  # [data-test=dropdown]
            # page.wait_for_load_state(timeout=120000)  # After 'load' event
            range_menu = page.locator("#dropdown-menu")
            # range_menu = page.get_by_text("Aug 28, 2022 - Aug 28, 2023").click(timeout = 30000, delay = np.random.rand() * 3000)
            # print(range_menu.inner_html())
            
            range_menu.get_by_text("5Y").click(timeout = 120000, delay = np.random.rand() * 3000)
            # page.wait_for_load_state(timeout=120000)  # After 'load' event
            print("找到時間範圍選擇")
            time.sleep(5)

            # page.get_by_text("Apply").click(timeout = 5000, delay = np.random.rand() * 1000)

            page.get_by_text("Apply").click(timeout = 30000, delay = 3000 + np.random.rand() * 2000)
            # page.wait_for_load_state(timeout=120000)  # After 'load' event
            print("按下Apply")
            

            # page.wait_for_load_state("")  # After 'load' event
            time.sleep(5)
            his_table = "<table>" + page.locator("data-test=historical-prices").inner_html() + "</table>"

            # his_price_selector = "data-test=historical-prices"
            # his_table = page.wait_for_selector(his_price_selector, state = "visible", timeout = 120000)
            # print(his_table)
            df_his_price = pd.read_html(his_table, index_col=0, header=0)[0]


            def want_value(content):        
                if re.search("[a-zA-Z]", str(content)):
                    return False
                return True
            
            def transform_to_number(content):
                return float(str(content).replace(" ",""))
            
            
            MA20_Month = np.average(df_his_price[df_his_price["Close*"].apply(want_value)]["Close*"].apply(transform_to_number).iloc[:20])
            print(company_name, "MA20 price:", MA20_Month)



            # 取得當前股價
            Current_Price = float(page.locator("[data-test=qsp-price][data-field=regularMarketPrice]").inner_text(timeout=120000))
            print(company_name, "current price:", Current_Price)

            # 計算股價與MA20之比例
            diff_ratio = (Current_Price - MA20_Month) / MA20_Month * 100
            print(company_name, "當前股價與MA20值相差比例:", diff_ratio, ("%"))

            # results.append((company_name, Current_Price, MA20_Month, diff_ratio))
            # return results.copy()

            # 使用共享的dict去做更新
            global_dict[company_name] = (Current_Price, MA20_Month, diff_ratio)
            
                           


        except Exception as e:
            print(str(e))

        finally:
            print("Finished!")
            context.close()
            browser.close()

        # current_url = page.url
        # print(menu.inner_html())


async def main():
    async with async_playwright() as playwright:
        with Pool(4) as p:
            for _ in range(10):
                p.apply_async(
                    my_test,
                    playwright
                )
            p.close()
            p.join()
        # await my_test(playwright)


